const LeftBar = (props) => {
  var timeSortedHistory = Object.keys(props.data).sort(function (a, b) {
    return (
      new Date(props.data[a].visitTime) - new Date(props.data[b].visitTime)
    );
  });

  return (
    <div className="absolute w-3/12 top-0 right-0 h-screen p-4 overflow-scroll">
      <div className="w-full text-2xl border-2 border-black p-4">
        History List
      </div>
      {timeSortedHistory.map((item) => {
        let d = Date.parse(item.visitTimeDate);
        let datetext = d.toLocaleString();
        console.log(datetext);
        return (
          <div className="w-full border-2 border-black my-2 p-4">
            <div>{item.visitTimeDate.split(" ")[1].split(".")[0]}</div>
            <div>{item.title}</div>
            <div className="truncate">{item.url}</div>
          </div>
        );
      })}
    </div>
  );
};

export default LeftBar;
